import styled from "styled-components";

export const LogoWrapper = styled.div`
	width: 60px;
	height: 60px;

  img{
    width:100%;

    height:100%;
  }
  /* @media screen and (max-width: ${props => props.theme.tablet}) {
		widt
	} */
`;
